var _skywhale_image_base64 = '';

var skywhale = {
  skywhale_div: undefined,
  animationTimerId: undefined,
  launchTimerId: undefined,
  floatDirectionFavour: 'left',
  delay: 2000,
  
  launch: function(delay) {
    document.body.appendChild(skywhale.generate_skywhale_element());
    skywhale.skywhale_div = document.getElementById('skywhale');
    skywhale.skywhale_div.style.left = (Math.random() * 100) + '%';
    skywhale.skywhale_div.style.top = '100%';
    skywhale.delay = (delay === undefined) ? skywhale.delay : delay;

    if (Math.random() < 0.5) {
      floatDirectionFavour = 'left';
    } else {
      floatDirectionFavour = 'right';
    }

    skywhale.animationTimerId = setInterval(function () {
    
      if (skywhale.skywhale_div.offsetTop <= (0 - 259)) {
        clearInterval(skywhale.animationTimerId);
        document.body.removeChild(skywhale.skywhale_div);
        skywhale.launchTimerId = setTimeout(skywhale.launch, skywhale.delay);
        return;
      }

      var topPercentage = (skywhale.skywhale_div.offsetTop / window.innerHeight) * 100;
      skywhale.skywhale_div.style.top = (topPercentage - 0.1) + '%';

      var left = skywhale.skywhale_div.offsetLeft;

      if (floatDirectionFavour == 'left') {
        if (Math.random() < 0.8) {
          skywhale.skywhale_div.style.left = left - (Math.random() * 1.5) + 'px';
        } else {
          skywhale.skywhale_div.style.left = left + (Math.random() * 1) + 'px';
        }
      } else {
        if (Math.random() < 0.8) {
          skywhale.skywhale_div.style.left = left + (Math.random() * 1.5) + 'px';
        } else {
          skywhale.skywhale_div.style.left = left - (Math.random() * 1) + 'px';
        }
      }
    }, 10);
  },

  hide: function() {
    clearTimeout(skywhale.launchTimerId);
    clearInterval(skywhale.animationTimerId);
    if (skywhale.skywhale_div) {
      skywhale.skywhale_div.remove();
    }
  },

  generate_skywhale_element: function() {
    var sw_el = document.createElement('div');
    sw_el.setAttribute('id', 'skywhale');
    sw_el.setAttribute('style', 'position: absolute; left: 0px; width: 329px; height: 259px; z-index: 99999; background: url(data:image/gif;base64,' + _skywhale_image_base64+ ') no-repeat;');

    return sw_el;
  }

};